// import Info from "./Info";
import {Link} from 'react-router-dom';
import './Icon.css'

function Icon(){
    return(
        <div class="container">
            <div  className="btn btn-1">
                <Link to="">
                    <h2>icon</h2>
                </Link>
            </div>
            <div className="btn btn-2">
                <Link to="" >
                {/* <i className="fa fa-chevron-up"></i> */}
                <h2>abt</h2>
            </Link>
</div>

<Link to="" className="btn btn-3">
  {/* <i className="fa fa-music"></i> */}
  <h2>blg</h2>
</Link>
<Link to="" className="btn btn-4">
  {/* <i className="fa fa-globe"></i> */}
  <h2>cnt</h2>
</Link>
<Link to="info" className="btn btn-5">
  {/* <i className="fa fa-leaf"></i> */}
  <h2>info</h2>
</Link>
</div>

    )
}

export default Icon
